import "./GetSongBpmSearch.css"

const GetSongBpmSearch = () => {

    const exampleResult = {
        title: "Example Song",
        artist: "Example Artist",
        tempo: 120
    }

    const results = (
        <table id="Table">
            <tr>
                <th></th>
            </tr>
            <tr>
                <td className="text" id="SongText">{exampleResult.title} - {exampleResult.artist}</td>
                <td className="text" id="BpmText">BPM: {exampleResult.tempo}</td>
            </tr>
        </table>
    )

        

    return (
        <div>
            <div className="SearchBar">
                <h2></h2>
                <input id="SearchBar" className="text" placeholder="Search getsongbpm.com..." />
                <button id="SearchButton" ></button>
            </div>
            <div id="SearchResults">
                {results}
            </div>
        </div>
    )
}

export default GetSongBpmSearch;
